% The total Number of bytes of data collected for each index i
numberOfBytesCollectedPerI = 64*1099511627776/256;

% Ensure that the histograms contain all required data by supplementing them from each other where necessary
% Supplement histogram_ij255_id12 from the last columns of i0k and i255k
histogram_ij255_id12(:, 1) = histogram_i0k_id12(:, 256);
histogram_ij255_id12(:, 256) = histogram_i255k_id12(:, 256);

% Supplement histogramDefault from the previous three histograms
histogramDefault_id12(1, :) = sum(histogram_i0k_id12);
histogramDefault_id12(256, :) = sum(histogram_i255k_id12);
histogramDefault_id12(2:255, 256) = (sum(histogram_ij255_id12(:, 2:255))).';

% Set the format to longe to capture the differences in the experimental probabilities
format longe

% The experimental conditional probability values observed for the output double bytes
experimentalCondProbs_i0k_id12 = histogram_i0k_id12 ./ numberOfBytesCollectedPerI;
